Dominick and Eugene (USA - 1988)           also known as La fuerza de un ser menor

Drama

starring . . . Tom Hulce, Ray Liotta, Jamie Lee Curtis

1 Award Win and 2 Nominations - Golden Globes, CSA, Venice Film Festival
