Twelve seconds and a world of difference separate Dominick and Eugene, fraternal twins whose mental abilities vary tremendously. Gino is a hard-working medical student, and his education is being paid for by Nicky, who is proud of being able to provide for his slightly younger brother. However, Nicky's own career is less distinguished, since he works cheerfully and at the height of his abilities as a garbage man. An accident that occurred when the twins were young has kept Nicky in a perpetually childlike state.

As directed by Robert M. Young, Dominick and Eugene has a refreshing plainness and a welcome unwillingness to milk the story for more pathos than is warranted. It examines the brothers' growing realization that, at 26, they must become more independent of one another. But it accomplishes this by means of genuinely involving plot developments, along with a rather startling denouement.


